import React from "react";
import Link from "next/link";
import "./global.module.css";

const Page = () => {
  return (
    <div className={style.body}>
      <h2>Index Page</h2>
      <div>
        <Link href="/notes">Link to notes</Link>
      </div>
    </div>
  );
};

export default Page;
